import styled from 'styled-components'
export const StyleChangePassword = styled.div`


    padding:20px;

     label {
       color: var(--gray);
     }
     .row{
       width:100%;

     }

     .aling-button {
       padding:  20px 0px 5px 0px;
     }

     .form-group {
       width:100%;
     }

     .btn {
      background-color: rgb(0, 142, 56)!important;
      height: 34px;
      padding: 0px;
      font-size: 15px;
      width: 150px;
    }

    .row-aling {
       display: flex;
       flex-wrap: inherit;
    }


    .row-aling {
      justify-content:  space-between;
    }


     h1 {
        display: flex;
        justify-content: center;
        color: black;
        padding:10px;
     }

     .painel {
        width: 58%;
     }

    @media(max-width:765px) {

      .painel {
       width: 100%;
       justify-content: center;
       display: contant;
      }

      .row-aling {
      justify-content:center
      }
      .input-aling {
         width: 88%;

      }
      .row {
            display: contents;
      }

      .btn {
        padding: 7px;

      }

      .aling-button {
        display: flex;
       justify-content: center;
      }


    }


    }



`
